import React, { useState, useEffect } from 'react';
import { Send, Loader2, Command, Sparkles } from 'lucide-react';

const App = () => {
  const [command, setCommand] = useState('');
  const [responses, setResponses] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [currentWord, setCurrentWord] = useState('Innovation');
  const [showDropdown, setShowDropdown] = useState(false);

  const words = ['Innovation', 'Creativity', 'AI Excellence', 'Empowerment'];

  const examples = [
    "What is current battery percentage?",
    "Create a text file with a poem",
    "Check system memory usage",
    "List running applications"
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentWord(prevWord => {
        const currentIndex = words.indexOf(prevWord);
        const nextIndex = (currentIndex + 1) % words.length;
        return words[nextIndex];
      });
    }, 3000);
    return () => clearInterval(interval);
  }, [words]);

  // Function to clean and format the response
  const cleanResponse = (response) => {
    if (typeof response !== 'string') return response;

    // Remove common command prompt artifacts
    let cleaned = response
      .replace(/Microsoft Windows \[Version .+?\]/g, '')
      .replace(/\(c\) Microsoft Corporation\. All rights reserved\./g, '')
      .replace(/C:\\.*?>/g, '')
      .replace(/PS C:\\.*?>/g, '')
      .replace(/Install the latest PowerShell.*?Windows/g, '')
      .replace(/Windows PowerShell.*?reserved\./g, '')
      .replace(/echo ""/g, '')
      .replace(/\s{2,}/g, ' ')
      .replace(/\n\s*\n/g, '\n')
      .trim();

    // Extract only the relevant output
    if (cleaned.includes('EstimatedChargeRemaining')) {
      const match = cleaned.match(/EstimatedChargeRemaining\s*-+\s*(\d+)/);
      if (match) {
        cleaned = `Current battery level: ${match[1]}%`;
      }
    }

    // Clean up file creation messages
    if (cleaned.includes('poem.txt')) {
      cleaned = cleaned.split('\n').filter(line => 
        !line.includes('is not recognized') && 
        !line.startsWith('echo') &&
        line.trim()
      ).join('\n');
    }

    return cleaned || 'Command executed successfully.';
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!command.trim()) return;

    setIsLoading(true);
    try {
      const res = await fetch('http://localhost:8000/process-command', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ command }),
      });
      const data = await res.json();
      if (res.ok) {
        const cleanedMessages = data.messages.map(msg => ({
          ...msg,
          content: cleanResponse(msg.content)
        }));

        setResponses(prev => [...prev, 
          { type: 'user', content: command },
          ...cleanedMessages
        ]);
        setCommand('');
      } else {
        throw new Error(data.message || 'Failed to execute command.');
      }
    } catch (error) {
      setResponses(prev => [...prev, 
        { type: 'user', content: command },
        { type: 'error', content: `Error: ${error.message}` }
      ]);
    } finally {
      setIsLoading(false);
    }
  };

  const handleExampleClick = (example) => {
    setCommand(example);
    setShowDropdown(false);
  };

  // Format the message content for display
  const formatMessage = (content) => {
    if (typeof content !== 'string') return content;

    // Convert markdown-style bold to styled spans
    return content.split('**').map((part, index) => 
      index % 2 === 0 ? part : <span key={index} className="font-bold text-cyan-300">{part}</span>
    );
  };

  return (
    <div className="min-h-screen bg-gradient-to-r from-purple-900 via-purple-800 to-purple-600 flex flex-col">
      {/* Header section remains the same */}
      <header className="w-full fixed top-0 bg-gradient-to-r from-purple-950 to-purple-800 shadow-lg z-50 border-b border-purple-500/20">
        {/* ... header content ... */}
      </header>

      {/* Main Container */}
      <div className="flex flex-col h-screen pt-24 pb-20">
        {responses.length === 0 && (
          <div className="text-center mb-8 space-y-4 px-4">
            <h2 className="text-4xl font-bold text-white mb-4">Welcome to PAAL AI</h2>
            <p className="text-lg text-white/80">Your intelligent assistant for anything and everything</p>
          </div>
        )}

        <div className="flex-grow overflow-hidden px-4 flex justify-center">
          <div className="w-full max-w-4xl bg-white/10 backdrop-blur-lg rounded-xl shadow-xl border border-white/10 flex flex-col">
            <div className="flex-grow overflow-y-auto p-6 space-y-4">
              {responses.map((msg, index) => (
                <div key={index} className={`flex ${msg.type === 'user' ? 'justify-end' : 'justify-start'}`}>
                  <div className={`max-w-[80%] rounded-xl p-4 ${
                    msg.type === 'user' 
                      ? 'bg-cyan-500/20 text-white ml-4' 
                      : msg.type === 'error'
                      ? 'bg-red-500/20 text-red-200 border-l-4 border-red-500'
                      : 'bg-white/5 text-white border-l-4 border-cyan-400'
                  }`}>
                    <p className="text-sm md:text-base whitespace-pre-wrap">
                      {formatMessage(msg.content)}
                    </p>
                  </div>
                </div>
              ))}
            </div>

            {/* Input area remains the same */}
            <div className="border-t border-white/10 p-4">
              {/* ... input form content ... */}
            </div>
          </div>
        </div>
      </div>

      {/* Footer remains the same */}
      <footer className="fixed bottom-0 w-full py-4 text-center text-white/60 text-sm bg-purple-950/50 backdrop-blur-sm border-t border-purple-500/20">
        Powered by <span className="text-cyan-400 font-semibold">PAAL AI</span>
      </footer>
    </div>
  );
};

export default App;
